// src/pages/PetDetails.jsx
import React, { useEffect, useState } from 'react';
import { useParams, Link, useNavigate } from 'react-router-dom';
import api from '../services/api';

export default function PetDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [pet, setPet] = useState(null);
  const [eventos, setEventos] = useState([]);
  const [erro, setErro] = useState('');

  useEffect(() => {
    async function fetchData() {
      try {
        const [petRes, eventosRes] = await Promise.all([
          api.get(`/api/pets/${id}`),               // ✅ corrigido
          api.get(`/api/eventos/pet/${id}`)         // ✅ corrigido
        ]);
        setPet(petRes.data);
        setEventos(eventosRes.data);
      } catch (err) {
        console.error(err);
        setErro('Erro ao carregar dados do pet ou eventos.');
      }
    }

    fetchData();
  }, [id]);

  const handleDelete = async () => {
    if (window.confirm('Tem certeza que deseja excluir este pet?')) {
      try {
        await api.delete(`/api/pets/${id}`);       // ✅ corrigido
        navigate('/pets');
      } catch (err) {
        console.error(err);
        setErro('Erro ao excluir o pet.');
      }
    }
  };

  if (erro) return <p className="text-danger">{erro}</p>;
  if (!pet) return <p>Carregando pet...</p>;

  return (
    <div className="container my-5">
      <h2>Detalhes do Pet</h2>
      <p><strong>Nome:</strong> {pet.nome}</p>
      <p><strong>Espécie:</strong> {pet.especie}</p>
      <p><strong>Raça:</strong> {pet.raca}</p>
      <p><strong>Porte:</strong> {pet.porte}</p>
      <p><strong>Cor:</strong> {pet.cor}</p>
      <p><strong>Sexo:</strong> {pet.sexo}</p>
      <p><strong>Peso:</strong> {pet.peso} kg</p>
      <p><strong>Castrado:</strong> {pet.castrado ? 'Sim' : 'Não'}</p>
      <p><strong>Carteira de Vacinação em Dia:</strong> {pet.vacinacao ? 'Sim' : 'Não'}</p>
      <p><strong>Data de Cadastro:</strong> {new Date(pet.dataCadastro).toLocaleDateString()}</p>

      <div className="d-flex gap-2 mt-4">
        <Link to={`/pets/${id}/editar`} className="btn btn-outline-primary">Editar</Link>
        <button onClick={handleDelete} className="btn btn-outline-danger">Excluir</button>
        <Link to="/pets" className="btn btn-secondary">Voltar à Lista</Link>
      </div>

      <hr className="my-4" />
      <h4>Eventos relacionados</h4>
      {eventos.length === 0 ? (
        <p>Nenhum evento registrado para este pet.</p>
      ) : (
        <ul className="list-group">
          {eventos.map((evento) => (
            <li key={evento._id} className="list-group-item">
              <strong>{evento.tipo}</strong> - Check-in: {new Date(evento.dataEntrada).toLocaleDateString()} - Check-out: {evento.dataSaida ? new Date(evento.dataSaida).toLocaleDateString() : 'em andamento'}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
